import React, { Component } from "react";
import * as TagNames from "../constants/constants";
import axios from "axios";
import Movies from "../common/movies";
// import { GetJSON } from "../common/getjson";

class Home extends Component {
  state = {
    movies: {
      results: [],
    },
  };

  async componentDidMount() {
    if (this.state.movies.length < 1) {
      const { data: movies } = await axios.get(TagNames.getURL());
      this.setState({ movies });
    }

    // // with fetchAPI -
    // const data = await GetJSON(TagNames.getURL());
    // const { results: movies } = data;
    // this.setState({ movies });
    // console.log("URL: " + url);
  }

  render() {
    const { results } = this.state.movies;
    return (
      <div>
        <Movies data={results} />
      </div>
    );
  }
}

export default Home;
